Este soneto está escrito por Lope de Vega, uno de los mayores exponentes de la literatura española del Siglo de Oro, y es un poema dedicado a San Isidro Labrador, santo patrón de Madrid. El texto pertenece al siglo XVII, por lo que la respuesta en JSON refleja estos datos.
